    {
        private const string stream = "data:image/jpeg;base64,";
        private ManagementImage? _drive;
        private Mock<ILogService> _mockLogService;
        private Mock<IImageCompressionService> _mockImageCompressionService;

        [TestInitialize]
        public void Setup()
        {
            var streamResult = new MemoryStream();
            _mockLogService = new Mock<ILogService>();
            _mockImageCompressionService = new Mock<IImageCompressionService>();

            OperationResult<Stream> operationResult = OperationResult<Stream>.Success(streamResult, "Compressed successfully");

            _mockImageCompressionService.Setup(x => x.CompressImage(It.IsAny<Stream>(), 75)).Returns(Task.FromResult(operationResult));
            _drive = new ManagementImage(_mockLogService.Object, _mockImageCompressionService.Object);
        }

        [TestMethod]
        public async Task When_UploadAsync_ValidStream_Then_Success()
        {
            // Given

            var filename = "test.jpeg";



            // TODO: Add other mocks, e.g., GoogleWebAuthorizationBroker, DriveService, etc.

            // When
            var result = await _drive?.UploadAsync(stream, filename);

            // Then
            Assert.IsTrue(result.IsSuccessful);
            //result.IsSuccessful.Should().BeTrue();
        }

        [TestMethod]
        public async Task When_UploadAsync_InvalidStream_Then_Failure()
        {
            // Given
            var filename = "test.jpeg";

            // When
            var result = await _drive?.UploadAsync(stream, filename); // Using '!' to bypass nullability check

            // Then
            Assert.IsNotNull(result);
            Assert.IsTrue(result.IsSuccessful);
